import { createBrowserHistory } from 'history';
const history = createBrowserHistory();
const axios = require('axios');

const API_ENDPOINT = "http://35.198.134.25:5000/api"

const config = {
  crossdomain: true
};

export default class UserService {
  // 
  // User management 
  // 
  static async login(email, password) {
    return axios.post(API_ENDPOINT + '/user/login', { "email": email, "password": password }, config)
      .then((response) => {
        console.log(response);
        if (response.data.status === true) {
          if (response.data.message === 'Please, valide your email.') {
            return (response.data)
          }
          localStorage.setItem('token', response.data.users.token);
          localStorage.setItem('email', email);
          localStorage.setItem('role', response.data.users.Role);
          history.push('/')
          window.location.reload()
        }
        return response.data
      }).catch((error) => {
        console.error(error)
        return error
      })
  }

  static async getAllUsers() {
    if (token === '') {
      history.push('/')
      window.location.reload()
    }
    return axios.get(API_ENDPOINT + '/users', { headers: { Authorization: `Bearer ${token}` } })
      .then((response) => {
        return response.data.users;
      }).catch((error) => {
        console.error(error)
        return error
      })
  }

  static async deleteUser(email) {
    if (token === '') {
      history.push('/')
      window.location.reload()
    }
    return axios.delete(API_ENDPOINT + '/user/delete', { data: { "email": email }, headers: { Authorization: `Bearer ${token}` } })
      .then((response) => {
        return response;
      }).catch((error) => {
        console.error(error);
        return (error)
      })
  }

  static async register(email, password) {
    return axios.post(API_ENDPOINT + '/user/new', { "email": email, "password": password }, config)
      .then((response) => {
        if (response.data.status === true) {
          localStorage.setItem('token', response.data.users.token);
          localStorage.setItem('email', email);
          localStorage.setItem('role', response.data.users.Role);
          history.push('/')
          window.location.reload()
        }
        return response.data
      }).catch((error) => {
        console.error(error)
        return (error)
      })
  }

  static async validAccount(email) {
    let local  = token;
    return axios.post(API_ENDPOINT + '/user/validate', { "email": email }, { headers: { Authorization: `Bearer ${local}` } })
      .then((response) => {
        console.log(response);
        return (response.data)
      }).catch((error) => {
        console.error(error)
        return (error)
      })
  }

  static async createUser(email, password) {
    if (token === '') {
      history.push('/')
      window.location.reload()
    }
    return axios.post(API_ENDPOINT + '/user/new', { "email": email, "password": password }, config)
      .then((response) => {
        return (response.data);
      }).catch((error) => {
        console.error(error)
        return (error)
      })
  }

  static async resetPassword(Password, Newpassword) {
    if (token === '') {
      history.push('/')
      window.location.reload()
    }
    return axios.put(API_ENDPOINT + '/user/resetPassword', { "password": Password, "newPassword": Newpassword }, { headers: { Authorization: `Bearer ${token}` } })
      .then((response) => {
        return response.data
      }).catch((error) => {
        console.error(error)
        return error
      })
  }

  static async setAdmin(email) {

    if (token === '') {
      history.push('/')
      window.location.reload()
    }

    return axios.post(API_ENDPOINT + '/user/setacl', { "email": email }, { headers: { Authorization: `Bearer ${token}` } })
      .then((response) => {
        return (response.data)
      }).catch((error) => {
        console.error(error)
        return (error)
      })
  }
}
